sys_variable_value.value:
(function execute(inputs, outputs) {
    var input_json = inputs.inputJSON;
    var delimeter_value = inputs.delimeter.toString().trim();
    var costCenterArray = new sn_sap_data_int.IntegrationsUtils().parseExecuteRFC(input_json, delimeter_value);
    outputs.cost_center_data = costCenterArray.JSONOBJECT;
    outputs.total_rows = costCenterArray.ROWCOUNT;
})(inputs, outputs);

